import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";
import { connect } from "react-redux";
import { axiosWithAuth } from "./Components/axiosWithAuth";
import { getId } from "./actions/postActions";
import Animation from './Components/Animation'
const Edit = (props) => {

    
  const handleSubmit = async(e) => {
    e.preventDefault();
    axiosWithAuth().post("/player", state)
      .then((res) => {
        console.log(res);
        window.location.reload()
      });
      console.log('clicked')
  };

  const onChange = (e) => {
    let name = e.target.value;
    if (name.length < 3) {
      setState((state) => ({
        ...state,
        [e.target.name]: e.target.value,
      }));
    }
    console.log(state);
  };
  const onChange2 = (e) => {
    let name = e.target.value;
    setState((state) => ({
      ...state,
      [e.target.name]: e.target.value,
    }));

    console.log(state);
  };

  const SelectChange = (e) => {
    setState((state) => ({
      ...state,
      [e.target.name]: e.target[e.target.selectedIndex].value,
    }));

    console.log(state);
  };
    return (
        <div>
            <form onSubmit={handleSubmit}>
          <Animation/>

                    <button onClick={handleSubmit}>Submit </button>

          <select name="Rep" onChange={SelectChange}>
            <option> Pro </option>
            <option> Allstar </option>
            <option> Superstar </option>
            <option> Elite </option>
            <option> Legend </option>
          </select>
          <select name="Type" onChange={SelectChange}>
            <option> Casual </option>
            <option> Competetive </option>
          </select>
          <select name="System" onChange={SelectChange}>
            <option> Playstation </option>
            <option> XBOX </option>
          </select>
          <select name="Position" onChange={SelectChange}>
            <option> Point Gaurd </option>
            <option> Shooting Gaurd </option>
            <option> Small Forward </option>
            <option> Power Forward </option>
            <option> Center </option>
          </select>
               <input
            value={state.Gamertag}
            name="Gamertag"
            onChange={onChange2}
            placeholder="Gamertag"
          />
          <input
            value={state.Archetype}
            name="Archetype"
            onChange={onChange2}
            placeholder="Archetype"
          />
          <input
            value={state.Overall}
            name="Overall"
            onChange={onChange}
            placeholder="Overall"
          />
          <input
            value={state.Winpercentage}
            name="Winpercentage"
            onChange={onChange}
            placeholder="Winpercentage"
          />

        </form> 
        </div>
    )
}

export default Edit
